import "../Style/dashboard.css"
import $ from 'jquery';



const dashOpen = () => {
    $('.dashOpen').css({
        Animation: `dashAnimUp .5 ease 0s `
    })
};

const dashClose = () => {
    $('.dashClose').addClass("close")
};

function dashboard() {

    return (
        <div className="dashboard">
            <div className="dashOpen" onClick={dashOpen}></div>
            <div className="dashClose" onClick={dashClose}></div>
        </div>
    );
}

export default dashboard;
